import Vue from 'vue';
import Vuetify from 'vuetify'; // Asegúrate de importar Vuetify correctamente
import 'vuetify/dist/vuetify.min.css'; // Importar los estilos de Vuetify
import App from './App.vue';

Vue.use(Vuetify); // Asegúrate de usar Vuetify correctamente

const vuetify = new Vuetify({
  theme: {
    themes: {
      light: {
        primary: '#1976D2',
        secondary: '#424242',
        accent: '#82B1FF',
        error: '#FF5252',
        info: '#2196F3',
        success: '#4CAF50',
        warning: '#FFC107'
      }
    }
  }
});

new Vue({
  vuetify,
  render: h => h(App),
}).$mount('#app');
